You meet Ernie, you can&#39;t help but fall in love with him.&nbsp; Ernie was a stray hanging out around one of our volunteer&#39;s neighborhoods.&nbsp; She took him to the vet to be neutered and found out he&#39;s FIV+.&nbsp; Ernie should live in a home so he will have a less stressful life than on the streets.&nbsp;

&nbsp;

Ernie is in a foster home at this time.&nbsp; He gets along with dogs and cats.&nbsp; If you&#39;d like to meet him, fill out our online adoption application at:&nbsp; https://colonycats.org/adoption_app.html . He&#39;s neutered, microchipped, FL negative and up to date on vaccines.&nbsp; DOB&nbsp; Feb 2014

&nbsp;




For more information about FIV &ndash; feline immunodeficiency virus visit this website: https://bestfriends.org/resources/fiv-cats-faqs-feline-immunodeficiency-virus




GW

Ted is a petite brindle boy with lots of love to give. He loves to just cuddle on the couch with his person and sleep or he loves to&nbsp;be outside going for a walk. He loves kids, and with a slow introduction to dogs, he has done well.&nbsp;


He doesn&#39;t need to be crated during the day so&nbsp;if he is&nbsp;left out with his fur siblings, he does amazing. He hasn&#39;t been cat tested, so we aren&#39;t sure how he would react.&nbsp;

&nbsp;

He is all together a wonderful dog. He&#39;s excelled well with his foster family and neighbors kids.&nbsp;

Meet Stu! He&#39;s a great dog with a big heart and whose favorite things to do is cuddle and receive belly rubs. He can be playful too so a fenced yard would be a plus but is not required, with a couple quick walks each day he does just fine. Stu currently lives with two other dogs and is fine most of the time &quot;occasionally rude to male&quot; but he does not do well with cats. He is food reactive and would do best in a home with kids 13 yrs. or older. He has some separation anxiety but that has been easy managed with proper medication. Stu is very well socialized with people, is eager to please and is food motivated. He is smart and responds well to training. He knows sit, wait, release command (&ldquo;okay&rdquo;) and does well on a harness lead for walks. He is about 6.5 years old and crate and house trained.

Stu&rsquo;s adoption fee is $175; he is neutered, microchipped, and up-to-date on all of his vaccines. If you are interested in meeting Stu, please contact us at adoption@ihadro.org or, you can find an adoption application at www.ihadro.org/forms

&nbsp;

Jackson is young handsome boy looking for a person to throw his ball! Would that be you?&nbsp;


Here are some fun facts about Jack(son)!&nbsp;

-Jackson knows sit, down and roll over. He is super smart and very eager to learn more.

-Jackson loves toys- balls, Kong&rsquo;s, squeaky toys, you name it!! He can entertain himself for hours!&nbsp;

-Jackson is a fun and goofy boy. You will be guaranteed to laugh with him!&nbsp;

-Jackson also enjoys car rides, laying in the sun and giving slobbery kisses!&nbsp;


In the shelter, Jackson was in play group with other dogs. He will need a dog companion to be patient and someone that will show him the ropes! He should be in the house with older children, as he is a big strong boy and no kitties. He is looking for an owner who wants to put as much love into him as he has to give. Can you give Jackson a chance?&nbsp;


Adoption applications can be found at&nbsp;
www.ihadro.org


&nbsp;

Rasputin is one of our favorite guys! Rasputin is FIV+. We don&#39;t know much about his back story, but he&#39;s been an excellent role model for the other cats in the FIV room since he came to us a few years ago. His favorite hobbies include sleeping in his favorite cubby and watching people and the occasional dog walk past the big window. 
(DOB 4/1/16)&nbsp;&nbsp;


**If interested in adopting me, please fill out an online adoption application at&nbsp;http://colonycats.org/adoption_app.html&nbsp;to expedite the process.&nbsp;&nbsp;Due to the large number of inquiries received, we are unable to respond to emails quickly.**

Louie&#39;s adoption donation is $300&nbsp;has been neutered, microchipped, received his rabies, distemper/parvo, bordetella&nbsp;and flu vaccinations, tested negative for heartworms and has started on prevention, as well as flea protection. He also has had a dental cleaning.

Louie was surrendered to a shelter for unknown reasons. Upon rescuing him, it was discovered he had a heart murmur. After a consultation with a cardiologist, Louie was diagnosed with several heart defects. Surgery was being considered until he was then diagnosed with a possible liver shunt. It was then decided to not do surgery. Louie&#39;s life expectancy is really unknown but with known medical issues he has been stable with us and has done very well.&nbsp; He had been with a foster home but unfortunately she could no longer care for him.&nbsp; Since he has been stable with regular monitoring, we are making available for adoption.

Louie has personality plus! He is a &quot;talker&quot; and is so enthusiastic about life! Squeaky toys are his favorite.&nbsp;Louie&nbsp; is also a little love bug and loves to cuddle with his people. He will snuggle right under your chin so he can lay his head on your heart.&nbsp;Louie is a &quot;typical &quot; miniature poodle as he&nbsp;can be protective. Louie loves food and has no problem trying to take food from any other dog so he is best to feed by himself. A home with older children is preferred. .&nbsp;

Louie does very well on house training if kept on a schedule. He likes to be outside but he is not a long walker as he tires easily. This little guy gets along with other dogs, but does do better with females than he does males.&nbsp;Louie is just adorable and anyone would fall in love with this lil guy.&nbsp;

&nbsp;

Nanna came to us with her litter of kittens.&nbsp; Her babies have been adopted and now it is her turn.&nbsp; She&rsquo;s spayed, vaccinated, microchipped, and tested FIV/FeLV negative and ready for a family to call her own. DOB August 2016.&nbsp; She&rsquo;s currently in foster care but will be coming to adoption events at Petco in Upper Arlington on the corner of Reed and Henderson Roads on Saturdays from noon till 4PM.&nbsp;

If you are interested in 
 adopting me, please visit Petco Upper Arlington during our Saturday adoption event or fill out an online adoption application at&nbsp;

https://colonycats.org/adoption_app.html&nbsp;

to expedite the process. 



Due to the large number of inquiries received, we are unable to respond to emails quickly.



GHW
